import java.util.Scanner;

public class Scan {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner scan = new Scanner(System.in);
        int a ;
        
        int turns = 3 ;
         while(turns  > 0){
        	   a = scan.nextInt();
        	   System.out.println(a);
        	   turns--;
        	   
         }
     

	}

}
